ast ride 6:30pm) **Additional Information:** - Participants must be over 42in (105cm) tall and weigh no more than 264lbs (120kg) - A Complete Release of Liability form must be signed before commencement of Segway rides. All guests below 18 years old must have their form signed by their guardian. Please obtain the form from the friendly Segway staff - You are required to bring a Photo ID and the operator reserves the right to request for identification documents to verify age claims and to deny access without proof of age - Smoking, using mobile devices and consumption of food and drinks are strictly prohibited during the ride - For your own safety, guests with the following conditions will not be allowed to ride, including but not limited to: heart conditions or abnormal blood conditions, extreme vertigo, recent surgery or easily aggravated conditions, expectant mothers, intoxication, epileps","title":"Go Green Segway® Tours","ticketTypesAndPackages":[{"id":1089,"hasSeries":false,"name":"Segway Fun Ride","currency":"SGD","favorited":false,"price":2.97,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":21.0,"settlementPrice":17.0,"merchantCurrency":"HKD","sourceName":"KLOOK UAT","sourceTitle":"Merchant","ableToDistributeToGlobaltix":false,"from":null,"did":618016},{"id":1090,"hasSeries":false,"name":"Segway Eco Adventure","currency":"SGD","favorited":false,"price":5.76,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":40.0,"settlementPrice":33.0,"merchantCurrency":"HKD","sourceName":"KLOOK UAT","sourceTitle":"Merchant","ableToDistributeToGlobaltix":false,"from":null,"did":619067}],"lastUpdated":"2017-06-19T05:06:38Z","dateCreated":"2017-06-19T05:06:37Z","createdBy":null,"series":[],"ticketTypes":[{"id":1089,"hasSeries":false,"name":"Segway Fun Ride","currency":"SGD","favorited":false,"price":2.97,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"}