:** *Mount Faber Line* - Mount Faber Station (for Mount Faber) - HarbourFront Station (for VivoCity, HarbourFront MRT) - Sentosa Station (for transfer to Sentosa Line at Imbiah Lookout) *Sentosa Line* - Imbiah Lookout (for [Skyline Luge](https://www.klook.com/activity/132-skyline-luge-singapore/), [Adventureland](https://www.klook.com/activity/136-sentosa-4d-adventureland-singapore/), [MegaZip](https://www.klook.com/activity/713-megazip-singapore/), [Madame Tussauds](https://www.klook.com/activity/1182-madame-tussauds-singapore/)) - Merlion Station (for Sentosa Merlion, [S.E.A Aquarium](https://www.klook.com/activity/119-sea-aquarium-singapore/), [Universal Studios Singapore](https://www.klook.com/activity/117-universal-studios-singapore/)) - Siloso Point Station: (for Fort Siloso, Siloso Beach) **Additional Information:** - Child ticket: Age 4-12 - Children 3 years and below can board for free - No outside food and drinks are permitted","title":"Singapore Cable Car Skypass","ticketTypesAndPackages":[{"id":1122,"hasSeries":false,"name":"Sky Pass","currency":"SGD","favorited":false,"price":3.84,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":33.0,"settlementPrice":22.0,"merchantCurrency":"HKD","sourceName":"KLOOK UAT","sourceTitle":"Merchant","ableToDistributeToGlobaltix":false,"from":null,"did":661837},{"id":1123,"hasSeries":false,"name":"Sky Pass","currency":"SGD","favorited":false,"price":3.14,"variation":{"enumType":"gt.enumeration.Variation","name":"CHILD"},"issuanceLimit":null,"originalPrice":22.0,"settlementPrice":18.0,"merchantCurrency":"HKD","sourceName":"KLOOK UAT","sourceTitle":"Merchant","ableToDistributeToGlobaltix":false,"from":null,"did":661838},{"id":1124,"hasSeries":false,"name":"Sky Pass + Buffet","currency":"SGD","favorited":false,"price":6.1,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":62.0,"settlementPrice":35.0,"merchantCurrency":"H