 or Adventure ticket - this can not be bought alone - Please note: All packages are only available for foreigners **Scheduling:** - Dolphin Discovery: 10:30am, 11:30am, 1:30pm, 2:30pm, 4:30pm, 5:00pm - Dolphin Adventure: 12:30pm, 3:30pm - Select your preferred time at check out. Please note that time slots are subject to availability and your allocated slot may not be your initial preference **Additional Information** - Child ticket: Age 4 – 12 (inclusive) - Senior ticket: Age 60 years and above - An observers ticket is available for those wanting to watch the activity but not get involved - Suitable for non-swimmers. Flotation devices are optional - Wetsuits will be provided for all programs - Personal photography and video are not allowed - Professional photographers are available onsite and will provide photographs for a fee GUESTS: - Will be required to shower prior to entering any pool or experiencing any attractions - Must be at least 110cm in height to participate - Children below 110cm in height must be accompanieed by a paying adult participant - If age 20 and below, must have a parent or guardian (21 years old and above) to authorize participation - If age 12 and below, must be accompanied in the water by a paying adult participant - There must be no more than 3 children accompanied by 1 adult **Important reminders:** - Bring appropriate swimwear to be worn under wetsuit (Swimwear Policy can be found [here](http://www.rwsentosa.com/LinkClick.aspx?file-ticket=8JvxuTHnWhc%3d&tabid=1390&language=en-US)) - DO NOT apply any type of tanning oil or sunscreen before entering the water - Do not bring any food and drinks into the par","title":"Dolphin Island Interaction Programs","ticketTypesAndPackages":[{"id":1140,"hasSeries":false,"name":"Dolphin Observer","currency":"SGD","favorited":false,"price":9.24,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":58.0,"settlementPrice":53.0,"merchantCurrency":"HKD","sour