20b7","description":"Indulge in a 4-course dinner, personalized butler service and magnificent skyline views aboard one of the worlds largest observation wheels! - Experience Asias largest observation wheel and take in captivating views of the city - Enjoy two full rotations of the wheel over a 4-course menu, served by an in-flight host - Collyer Quay, The Fullerton, Esplanade Theatres, Merlion Park, the F1 Circuit, Helix Bridge, Marina Bay Sands…count the landmarks you can spot from 165m above ground! - Step into the Journey of Dreams, an interactive multimedia feast showcasing the story behind the Singapore Flyer","merchant":{"name":"KLOOK UAT","class":"com.globaltix.api.v1.Merchant","id":174},"hoursOfOperation":"**Inclusive Of:** - 4-course meal: Choice of Western, Chinese or Vegetarian cuisine (Please see menu below and make your choice during check out) - Two rotations aboard the observation wheel (1 hour duration) - In-flight host - Exclusive check-in (Express Boarding) - Entry to Journey of Dreams (optional) **Menu:** - Regular Menu (2 Jan 2017 to 30 Jun 2017): Click [here](http://res.klook.com/image/upload/v1487739129/Singapore_Flyer_Premium_Sky_Dining_Jan_-_Jun_2017_Menu_l2qxsk.pdf) to view **Package Options:** - Premium Dinner: 7:30pm, 8:30pm - Please choose your preferred timing at check out **Additional Information:** - Children under the age of 7 are not permitted for Sky Dining","title":"Singapore Flyer Premium Sky Dining","ticketTypesAndPackages":[{"id":1153,"hasSeries":false,"name":"Premium Dinner","currency":"SGD","favorited":false,"price":30.85,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":184.0,"settlementPrice":177.0,"merchantCurrency":"HKD","sourceName":"KLOOK UAT","sourceTitle":"Merchant","ableToDistributeToGlobaltix":false,"from":null,"did":703632}],"lastUpdated":"2017-06-19T05:25:24Z","dateCreated":"2017-06-19T05:25:23Z","createdBy":null,"series":[],"ticketTypes":[{"id":1153,"hasSeries