s, haricot beans and carrot basil cream and cheese mousse with wild betty compote for dessert - Vegetarian option (please select at check out): welcome drink, marinated Portobello mushroom, roast butternut pumpkin and apple soup, pan fried potato cutlet and Haagen Daz mango sorbet for dessert - Click [here](http://res.klook.com/image/upload/v1463979278/Map%20photos/Dining_on_Cloud_9__TA_VEG_Booking_Form_FY16.jpg) for detailed menus - Complimentary one glass of house wine for each diner and a box of chocolates per couple *Sky Dining - Singapore Delights* - 6:00pm-8:00pm (Diners who arrive after 7:00pm will have their dinner duration shorten to 1 rounds instead of 2 rounds) - Each round takes 30 minutes so this activity will last approximately 60 minutes - Menu: traditional Hainanese chicken rice with condiments, wok fried chilli crab meat with mini mantou, Tim Sum crispy prawn wanton, Malay style Tahu Goreng with peanut sauce, Keropok, rainbow cake and Bandung in can - Click [here ](http://res.klook.com/image/upload/v1463979301/Map%20photos/Sky_Dining_Singapore_Delights_TA_Booking_Form_FY16.jpg)for detailed menu **Additional Information:** - No outside food and drinks are permitted - All items on the menu are pork and lard-free but not Halal certified - Menus are subject to changes without prior notice - The company reserves the right to prohibit any person on board other than the diners - Please note that each cabin can accommodate a maximum of 4 guests. If you have more than 4 people in your group, your group will be split up into separate cabins","title":"Cable Car Dining","ticketTypesAndPackages":[{"id":1154,"hasSeries":false,"name":"Dining on Cloud 9","currency":"SGD","favorited":false,"price":24.23,"variation":{"enumType":"gt.enumeration.Variation","name":"ADULT"},"issuanceLimit":null,"originalPrice":169.0,"settlementPrice":139.0,"merchantCurrency":"HKD","sourceName":"KLOOK UAT","sourceTitle":"Merchant","ableToDistributeToGlobaltix":false,"from":null,"did":7046